/*Table structure for table `ticket_delivery` */

DROP TABLE IF EXISTS `ticket_delivery`;

CREATE TABLE `ticket_delivery` (
  `id` int(11) NOT NULL auto_increment,
  `agent_id` int(11) NOT NULL,
  `purchase_date` datetime default NULL,
  `price` varchar(100) character set latin1 default NULL,
  `tax` varchar(100) character set latin1 default NULL,
