  `collection_date` datetime default NULL,
  `accounting_id` int(11) default NULL,
  `office` varchar(200) character set latin1 default NULL,
  `isActive` tinyint(4) default '1',
  `isInvoice` tinyint(2) default '0',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=114 DEFAULT CHARSET=utf8;

